nges in the database.\nPlease confirm that this is what you intend to do.\";'),(_binary 'en',_binary 'messages:lockconfirm',_binary 's:40:\"Yes, I really want to lock the database.\";'),(_binary 'en',_binary 'messages:unlockconfirm',_binary 's:42:\"Yes, I really want to unlock the database.\";'),(_binary 'en',_binary 'messages:lockbtn',_binary 's:13:\"Lock database\";'),(_binary 'en',_binary 'messages:unlockbtn',_binary 's:15:\"Unlock database\";'),(_binary 'en',_binary 'messages:locknoconfirm',_binary 's:39:\"You did not check the confirmation box.\";'),(_binary 'en',_binary 'messages:lockdbsuccesssub',_binary 's:23:\"Database lock succeeded\";'),(_binary 'en',_binary 'messages:unlockdbsuccesssub',_binary 's:21:\"Database lock removed\";'),(_binary 'en',_binary 'messages:lockdbsuccesstext',_binary 's:120:\"The database has been locked.<br />\nRemember to [[Special:UnlockDB|remove the lock]] after your maintenance is complete.\";'),(_binary 'en',_binary 'messages:unlockdbsuccesstext',_binary 's:31:\"The database has been unlocked.\";'),(_binary 'en',_binary 'messages:lockfilenotwritable',_binary 's:116:\"The database lock file is not writable.\nTo lock or unlock the database, this needs to be writable by the web server.\";'),(_binary 'en',_binary 'messages:databasenotlocked',_binary 's:27:\"The database is not locked.\";'),(_binary 'en',_binary 'messages:lockedbyandtime',_binary 's:33:\"(by {{GENDER:$1|$1}} on $2 at $3)\";'),(_binary 'en',_binary 'messages:move-page',_binary 's:7:\"Move $1\";'),(_binary 'en',_binary 'messages:movepage-summary',_binary 's:0:\"\";'),(_binary 'en',_binary 'messages:move-page-legend',_binary 's:9:\"Move page\";'),(_binary 'en',_binary 'messages:movepagetext',_binary 's:904:\"Using the form below will rename a page, moving all of its history to the new name.\nThe old title will become a redirect page to the new title.\nYou can update redirects that point to the original title automatically.\nIf you choose not to, be sure to check for [[Special:DoubleRedirects|double]] or [[Special:BrokenRedirects|broken redirects]].\nYou are responsible for making sure that links continue to point where they are supposed to go.\n\nNote that the page will <strong>not</strong> be moved if there is already a page at the new title, unless the latter is a redirect and has no past edit history.\nThis means that you can rename a page back to where it was renamed from if you make a mistake, and you cannot overwrite an existing page.\n\n<strong>Warning!</strong>\nThis can be a drastic and unexpected change for a popular page;\nplease be sure you understand the consequences of this before proceeding.\";'),(_binary 'en',_binary 'messages:movepagetext-noredirectfixer',_binary 's:801:\"Using the form below will rename a page, moving all of its history to the new name.\nThe old title will become a redirect page to the new title.\nBe sure to check for [[Special:DoubleRedirects|double]] or [[Special:BrokenRedirects|broken redirects]].\nYou are responsible for making sure that links continue to point where they are supposed to go.\n\nNote that the page will <strong>not</strong> be moved if there is already a page at the new title, unless it is a redirect and has no past edit history.\nThis means that you can rename a page back to where it was renamed from if you make a mistake, and you cannot overwrite an existing page.\n\n<strong>Warning!</strong>\nThis can be a drastic and unexpected change for a popular page;\nplease be sure you understand the consequences of this before proceeding.\";'),(_binary 'en',_binary 'messages:movepagetalktext',_binary 's:258:\"The associated talk page will be automatically moved along with it <strong>unless:</strong>\n*A non-empty talk page already exists under the new name, or\n*You uncheck the box below.\n\nIn those cases, you will have to move or merge the page manually if desired.\";'),(_binary 'en',_binary 'messages:movearticle',_binary 's:10:\"Move page:\";'),(_binary 'en',_binary 'messages:moveu