lle morte lorsqu\'ilu800 neu800 reste plus queu800 deux balles u8c3a0 jouer etu800 queu800 leu800 score estu800 u8c3a0 u8c3a9galitu8c3a9. ainsi leu800 match seu800 terminera forcu8c3a9ment enu800 golden ball . lu800\'u8c3a9quipe quiu800 rentre lau800 balle morte obtient lu800\'engagement afin queu800 leu800 fait deu800 marquer neu800 lau800 du8c3a9savantage pasu800 pour lau800 balle deu800 match enu800 donnant lau800 balle u8c3a0 lu800\'adversaire. su800\'ilu800 yu800 au800 uneu800 pu8c3aache ouu800 uneu800 gamelle suru800 lau800 balle morte elle su800\'annule etu800 redevient uneu800 balle normale. lesu800 interdits lesu800 interdits lesu800 interdits lesu800 tacles malgru8c3a9 leur certaine utilitu8c3a9 lesu800 tacles sont moches anti-sportif etu800 abu8c3aement leu800 baby-foot. certains lesu800 acceptent auquel casu800 ilu800 neu800 faut pasu800 trop lever sesu800 joueurs lors deu800 contru8c3b4les. ilu800 estu800 aussi interdit deu800 rentrer lau800 derniu8c3a8re balle avec lesu800 demis cela fait perdre 2u800 points u8c3a0 lu800\'auteur. lors du800\'uneu800 partie enu800 2u800 contre 1u800 certains interdisent lesu800 bandes deu800 lu800\'arriu8c3a8re pour lu800\'u8c3a9quipe deu800 deux. mais ceci ru8c3a9duit inutilement leu800 jeuu800. '),(7,_binary 'manifeste agile',_binary ' 4u800 valeurs nous du8c3a9couvrons deu800 meilleures approches duu800 du8c3a9veloppement logiciel enu800 leu800 pratiquant etu800 enu800 aidant lesu800 autres u8c3a0 leu800 pratiquer. ceu800 travail nous au800 amenu8c3a9 u8c3a0 accorder deu800 lu800\'importance 4u800 - auxu800 individus etu800 leurs interactions plutu8c3b4t quu800\'auxu800 processus etu800 auxu800 outils ; - u8c3a0 unu800 logiciel fonctionnel plutu8c3b4t quu8e28099u8c3a0 uneu800 documentation exhaustive ; - u8c3a0 lau800 collaboration avec lesu800 clients plutu8c3b4t quu800\'u8c3a0 lau800 nu8c3a9gociation contractuelle ; - u8c3a0 lu8e28099adaptation auu800 changement plutu8c3b4t quu800\'u8c3a0 lu800\'exu8c3a9cution du8e