INSERT INTO `text` VALUES (1,_binary '<strong>MediaWiki a été installé avec succès.</strong>\n\nConsultez le [//meta.wikimedia.org/wiki/Help:Contents/fr Guide de l’utilisateur] pour plus d’informations sur l’utilisation de ce logiciel de wiki.\n\n== Pour démarrer ==\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Liste des paramètres de configuration]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Manual:FAQ/fr Questions courantes sur MediaWiki]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Liste de discussion sur les distributions de MediaWiki]\n* [//www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Adaptez MediaWiki dans votre langue]',_binary 'utf-8'),(2,_binary '----\n\n[[File:DevOps.png]]\n\n----\n[[MANIFESTE AGILE]]\n----\n[[PILLIERS DEVOPS]]\n----\n[[REGLE BABY EQARE]]\n----\n[[REGLE BABY LBP]]\n----',_binary 'utf-8'),(3,_binary 'Importing file',_binary 'utf-8'),(4,_binary '== Les règles du jeu officielles EQARE du Baby Foot ==\n\nOn connait tous plus ou moins les règles du football de table : il faut marquer le plus de but à l’adversaire et en encaisser le moins possible. C’est à peu près comme tout sport avec un ballon !\nMais le baby foot qui a pris son essor dans les troquets a aussi une fédération en France et celle-ci a définie comment jouer au babyfoot, ce qui est autorisé et ce qui ne l’est pas. Pour les amoureux du jeu de café, cela peut déstabiliser mais comme on dit : les règles sont les règles !\nEt surtout si vous voulez vous habituer aux parties lors de compétitions et participer à des tournois régionaux voire nationaux, vous devrez vous y faire !\n\nVoici un résumé du règlement simplifié publié par la FFFT (Fédération Française de Football de Table) :\n\nLe but du jeu afin de gagner est de remporter 3 manches sur 5. Dans le cas d’un résultat de 2 manches à 2, la 5ème manche devra être remportée avec une différence de 2 points.\n\n=== Article 1 : L’engagement au baby foot === \n\nIl faut au début de la partie décider de qui va commencer. Il faut donc procéder à un tirage au sort qui pourra prendre l’aspect d’un jeter de pièces à pile ou face ou tout autre procédé que les joueurs accepteront. Ensuite, une fois le vainqueur de ce tirage au sort décidé, l’engagement se fait au niveau des demis avec la balle arrêtée sous les pieds du joueur central.\nDans le cas où l’engagement se fait après un but, le joueur ayant encaissé le but est celui qui bénéficie de l’engagement et qui peut donc poser la balle sous ses demis.\n\n=== Article 2 : La remise en jeu === \n\nDans le cas d’une sortie de balle du terrain de jeu, la balle est donnée aux arrières de l’équipe qui n’était pas en possession de la balle qui est sortie. Ainsi, si un attaquant rouge, un défenseur rouge ou un milieu rouge frappe et que la balle sort du terrain, la remise en jeu est faite aux arrières bleus.\nDans le cas où la balle est bloquée entre 2 barres à un point mort où personne ne peut l’atteindre, la balle est remise aux arrières du camp où se situe la balle. Et dans le cas d’une balle qui serait bloquée entre les milieux, la balle est redonnée au dernier ayant eu l’engagement.\n\n=== Article 3 : Le « prêt ? » === \n\nDans un esprit fair play lors d’un engagement ou d’une remise en jeu, celui qui bénéficie de celui-ci doit demander à son adversaire s’il est prêt et attendre que celui-ci réponde qu’il est prêt. Souvent vous entendrez tout simplement « prêt ? », « prêt ! » mais vous pouvez aussi varier et utiliser l’anglais pour changer : « ready !? ».\n\n=== Article 4 : Les pissettes au babyfoot === \n\nLes tirs des ailiers avant (les attaquants des extrémités) en diagonal lorsque les défenseurs et goal sont poussés (ou tirés) à fonds sont autorisés qu’ils soient tirés à gauche comme à droite.\n\n=== Article 5 : Les reprises au baby-foot === \n\nLes reprises sont autorisées aussi bien en double qu’en simple. C\'est-à-dire que sont valides les buts lorsque vous déviez une balle qui arrive des demis ou des arrières, lorsque vous la bloquez et que vous frappez immédiatement après. Vous n’avez pas besoin d’attendre que votre adversaire soit prêt pour continuer votre jeu et marquer !! Il en est de même si la balle rebondie après avoir touché les murs du terrain, vous pouvez frapper la balle immédiatement, le tir ne sera pas assimilé à une reprise. Pour résumer, « la reprise » n’existe pas et toute frappe est autorisée avec ou sans contrôle préalable.\n\n=== Article 6 : Les roulettes au baby-foot === \n\nLa roulette est autorisée dans une certaine mesure : vous ne pouvez pas effectuer plus d’un tour avant la frappe de la balle ni après la frappe de la balle. Mais cela veut donc dire que si vous faites une rotation de 350° avant de toucher la balle et vous continuer avec encore 350° après la frappe, le tir est autorisé ! Même si comme vous le comprendrez, au total, votre joueur aura fait 700° de rotation… Cela vous permet notamment de réaliser des snake shots.\n\n=== Article 7 : La gamelle au babyfoot ===  \n\nLa gamelle qui est le terme désignant un but dont la balle est entrée dans les cages, a tapé le fond et est ressortie a la même valeur qu’un but normal. A la suite d’un tel but, le réengagement se fait aux demis comme dans le cas d’un but classique. Il n’y a pas de points enlevés ou de double point.\n\n=== Article 8 : Changement de position === \n\nLorsque vous jouez à 2 contre 2, vous pouvez changer de position au moment d’un engagement ou d’un temps mort. Cela vous permettra d’intervertir vos rôles en passant d’attaquant à défenseur.\n===  Article 9 : Les demis au baby foot === \n\nLes buts qui sont marqués des demis sont valables et comptent pour un point. Lorsque les arrières d’une équipe dégagent la balle, l’autre équipe a le droit de bouger les demis comme les autres joueurs. Toutes les techniques de jeu intitulées « rateaux », « sacs » ou encore « brailles » sont autorisées et ne constituent pas une faute de jeu. Dévier la balle de l’adversaire est autorisé même avec les demis.\n\n \n=== Les interdictions au Football de table === \n\n -     Utiliser des accessoires non-conformes aux règles\n -     Utiliser vos mains dans le baby foot au cours quand la balle est en jeu au cours d’une partie\n -     Faire bouger la table de jeu (volontairement ou involontairement)\n -     Tordre les barres\n -     Toutes les gênes et distractions comme crier, faire des grimaces, donner des grands coups pour créer des chocs avec ses demis ou ses défenseurs, faire vibrer la table, etc…\n -     Avoir une attitude négative, agressive et insultante\n\nVous pouvez retrouver ces règles de jeu sur le site de la fédération de football de table. Il existe une version simplifiée des règles de jeu de football de table mais aussi une version complète pour être sur de ne rien manquer.',_binary 'utf-8'),(5,_binary '== Règles du Baby-foot LBP == \n\nVoici quelques-unes des règles pouvant être adoptées lors de la pratique du Baby-foot dans les cafés.\nCe jeu étant un loisirs, les règles peuvent être amenées à être modifiées selon l\'entente \"cordiale\" entre les joueurs. Il est ainsi préférable d\'énoncer les règles en vigueur durant le match avant d\'entamer la partie.\n\n=== ARTICLE 1 : L\'ENGAGEMENT === \n\nD\'ordinaire, la première balle se lance contre le bois du baby-foot, puis se dirigera d\'un côté. La balle ne pourra passer les demis et se diriger vers une cage que lorsqu\'elle aura touchée les deux barres des demis \"touche-touche\". Une autre méthode peut-être tout simplement de donner la balle a l\'équipe qui paye la partie. Par la suite c\'est à l\'équipe qui c\'est prise le but qui engage, en contrôlant la balle avec les demis après qu\'elle soit passée (par exemple) sous les demis adverses.\n\n=== ARTICLE 2 : LA REMISE EN JEU === \n\nLorsque la balle s\'immobilise entre les demis, on refait un engagement contre le bois. Autrement, la balle doit être remise dans un des coins du côté ou elle s\'est immobilisée, afin que le défenseur de ce camp la contrôle. Si la balle sort du terrain de jeu, on la remet dans un des coins du côté ou elle est sortie. Suite à un dégagement des défenseurs, on la rend habituellement du côté des défenseurs ayant dégagé. Dans certains cas, lorsque la balle est assez proche d\'un joueur, il y a possibilité de tordre la barre afin de la récupérer. Mais ceci est mal, certains joueurs ne l\'acceptent pas et cela endommage inutilement le baby-foot. Lors d\'une remise de balle en coin, si le défenseur n\'arrive pas à contrôler la balle, l\'attaquant se doit de lui remette gentiment (avec le sourire). Ce geste de fair-play peut être adopté pour l\'ensemble de la partie, i.e. dès que le défenseur perd la balle, malgré tout, cela peut vite devenir pénible si l\'adversaire rate tous ses contrôles.\n\n=== ARTICLE 3 : LES PISSETTES === \n\nLa pissette est le joueur le plus près de la poignée sur la barre des attaquants. Faire une pissette est le fait de tirer au but avec ce joueur et ceci est interdit, jugé trop facile car il y a un grand \"angle mort\" (même si il suffit pour le défenseur d\'adapter sa garde...). (Allez voir les techniques pour l\'animation.) Remarque : Le baby-foot étant symétrique, si l\'attaquant tire avec le joueur le plus éloigné de sa poignée alors que le défenseur est en garde inversé, le même angle se créé, malheureusement, personne ne compte ce coup comme interdit.\n\n=== ARTICLE 4 : LES REPRISES === \n\nEn simple, il est coutume d\'attendre que le défenseur ait les mains sur les cannes avant de tirer. Il faut donc se passer des reprises. En double, il n\'existe pas de règes explicite les interdisant, mais les gens n\'apprécient pas vraiment et cela ne fait pas preuve d\'une réelle maîtrise (sauf en cas d\'enchaînement avec une passe des demis).\n\n=== ARTICLE 5 : LES RATEAUX, CASSES, BRAILLES, SACS, BARRIERES === \n\nIl y a \"râteau\", \"casse\", \"braille\" \"barrière\" ou \"sac\" lorsqu\'une balle partant des demis est déviée par les demis adverses empêchant ainsi les attaquants de la contrôler. Si l\'attaquant la touche, il n\'y a pas de faute. Lorsque la balle vient d\'un dégagement arrière le râteau ne compte pas, mais certains parlent de \"bougeage\".(Si l\'Académie française me voyait... ) Normalement, les passes des demis vers l\'arrière ne sont pas admises, même lorsque le joueur aux demis la contrôle avant, étant donné qu\'en général ceci n\'est pas volontaire, c\'est le joueur qui ne maîtrise pas super bien, donc cela compte comme un râteau. Après tout, pourquoi voudrait-il passer la balle à l\'arrière ? A moins qu\'il n\'assure pas devant... Au bout de deux ou trois râteaux consécutifs (i.e. sans que la balle n\'ai été contrôlé ailleurs qu\'aux), on donne la balle directement à l\'attaquant. Lorsque la partie est payante, le râteau but fait perdre un point à l\'équipe auteur du râteau (celle s\'étant pris le but).\n \n=== ARTICLE 6 : LES DEMIS === \n\nEn essayant de récupérer la balle aux demis, il est interdit de taper les bois plusieurs fois de suite en faisant des allers-retours à toute vitesse. Ceci est une très mauvaise technique, c\'est vilain, et est la preuve d\'un manque de maîtrise des demis... Lors d\'un dégagement arrière, il est interdit de bouger ses demis, il faut les positionner avant que le défenseur ne dégage. Sinon, il y a \"bougeage\" Les mouvement de poignée (décrivant une rotation selon l\'axe de la barre) sont quant à eux autorisés. En revanche, l\'on peut bouger ses demis lorsque:\n• Le défenseur relance en bande; la balle est contrée par les attaquants au moment de la relance.\n• Le défenseur renvoie la balle en reprise, sans la contrôler.\n\nSi quelqu\'un est pris en flagrant délit de bougeage de demis, il y a en général, dans un premier temps avertissement verbale ( \"t\'es lourd, là, arrêtes de les bouger tes put... de demis\"). Si l\'adversaire récidive, on peut toujours rendre la balle à l\'arrière voir même la donner directement aux attaquants... Lorsque la partie est payante (avec nombre de balles limité), si un but provient des demis, on met deux points en jeux, le prochain but valable comptera ainsi pour deux points. Si il y a encore demis, on met 3 points en jeu, par contre, si il arrive un troisième but des demis, c\'est -2 points pour l\'auteur du but. Dans le cas d\'un baby-foot non payant, on compte le but comme balle morte. Lorsqu\'il y a engagement avec contrôle, la balle doit obligatoirement aller vers le but adverse. Si par maladresse un joueur qui effectue l\'engagement tape la balle vers ses défenseurs, on recommence l\'engagement. On appelle ceci une \"progression\" ou \"progress\".\n\n=== ARTICLE 7 : LA GAMELLE === \n\nLa gamelle (balle entrée et ressortie) vaut -1 qu\'elle soit été effectuée de l\'avant ou de l\'arrière. Certains comptent les gamelles de l\'arrière -1, +1. En réalité la gamelle ne vaut -1 uniquement si l\'attaque le veut bien, si elle préfère se rajouter un point, comme un but normal, elle en a entièrement le droit. Sur une balle de match ou \"golden ball\", certains racontent qu\'on ne peut pas s\'ajouter un point et que l\'on est obligé d\'enlever le but à l\'adversaire. Ceci est bien pour le suspens, mais pourquoi le fait de faire une gamelle pourrait désavantager l\'équipe qui l\'a faite ? Il paraîtrait qu\'il soit possible de faire une gamelle qui ressorte de l\'autre coté (gamelle blanche/royale ou encore chaudron), tout le monde en parle mais personne ne l\'a jamais vu ! Il faut avoir une chance monstrueuse... Si par miracle cela vous arrive, c\'est +5 -5, \"Bel avantage n\'est-ce pas ?\", mais malheureusement ceci ne vous arrivera pas deux fois dans votre vie. En revanche, il est possible d\'aller pêcher dans le but opposé lorsque la balle remonte, ceci est beaucoup moins prestigieux et ne rapporte rien, sinon comme une pêche ou gamelle classique.\n\n=== ARTICLE 8 : LES PÊCHES === \n\nPêcher est l\'action de tirer puis de récupérer la balle dans la cage avant qu\'elle ne descende dans le baby-foot. Pêcher revient à faire une gamelle (mais c\'est quand même plus facile), donc soit on enlève un point à l\'adversaire, soit on s\'en rajoute un. En revanche, les pêches défensives sont interdites. Cela peut donner des matchs interminables, où le défenseur ne cherche plus à arrêter les tirs avec ses joueurs mais à se ruer dans sa cage une fois le tir déclenché. Cela est ridicule, le vrai mérite de la pèche est d\'une part de marquer, puis d\'autre part d\'être assez rapide pour aller chercher la balle. Si par mégarde un joueur tente de pêcher et heurte la balle alors qu\'elle est encore en jeu, il y a main au tapis, et la c\'est -1 pour celui qui a commis la faute. Par contre il est interdit, et c\'est assez dangereux, lorsque l\'on est gardien, d\'essayer d\'empêcher l\'attaquant d\'aller à la pêche en lui labourant la main avec son joueur. Cela est dangereux d\'une part parce que ça peut faire extrêmement mal, et d\'autre part parce que si la personne en face le prend mal, cela peut très vite en venir aux mains (mais pas pour aller à la pêche cette fois). Le geste fair-play est de lâcher ses barres lorsque l\'on encaisse un but et que l\'adversaire tente une repêche.\n\n=== ARTICLE 9 : LES LOBS === \n\nTraditionnellement un lob compte +2 (i.e. lorsque la balle passe au dessus de la barre du goal). Personnellement, je compte toujours +1 sauf lorsque ceci est annoncé, car bien des fois c\'est de la chance. Si y\'a gamelle après le lob, c\'est -2 points pour l\'adversaire. En défense, si l\'adversaire tente de faire un lob, on n\'a pas le droit de lever les attaquants pour contrer la balle, seul le gardien à la permission de se renverser pour l\'arrêter. Certains acceptent mal cette règle, mais cela permet le spectacle...\n\n=== ARTICLE 10 : LES CENDARS === \n\nIl y a cendar lorsque la balle vient se loger dans le cendrier sur le côté de la cage. Le cendar est bénéfique lorsqu\'il est réalisé du côté ou l\'on doit marquer. En règle générale un cendar vaut +3 -3. Dans tout les cas c\'est 100% chance.\nARTICLE 11 : LA BALLE MORTE\n\nIl y a balle morte lorsqu\'il ne reste plus que deux balles à jouer et que le score est à égalité. (Ainsi, le match se terminera forcément en \"golden ball\"). L\'équipe qui rentre la balle morte obtient l\'engagement, afin que le fait de marquer ne la désavantage pas pour la balle de match en donnant la balle à l\'adversaire. S\'il y a une pêche ou une gamelle sur la balle morte, elle s\'annule et redevient une balle normale.\n\n=== LES INTERDITS === \nLes tacles, malgré leur certaine utilité, les tacles sont moches, anti-sportif et abîment le baby-foot. Certains les acceptent auquel cas, il ne faut pas trop lever ses joueurs lors de contrôles. Il est aussi interdit de rentrer la dernière balle avec les demis, cela fait perdre 2 points à l\'auteur. Lors d\'une partie en 2 contre 1, certains interdisent les bandes de l\'arrière pour l\'équipe de deux. Mais ceci réduit inutilement le jeu.',_binary 'utf-8'),(6,_binary '== 4 Valeurs ==\n\nNous découvrons de meilleures approches du développement logiciel en le pratiquant et en aidant les autres à le pratiquer. Ce travail nous a amené à accorder de l\'importance 4 :\n\n    - aux individus et leurs interactions plutôt qu\'aux processus et aux outils ;\n    - à un logiciel fonctionnel plutôt qu’à une documentation exhaustive ;\n    - à la collaboration avec les clients plutôt qu\'à la négociation contractuelle ;\n    - à l’adaptation au changement plutôt qu\'à l\'exécution d’un plan.\n\nCela signifie que, bien qu\'il y ait de la valeur dans les éléments situés à droite, notre préférence se porte sur les éléments qui se trouvent à gauche. \n\n== 12 Principes ==\n\n    - Notre plus haute priorité est de satisfaire le client en livrant rapidement et régulièrement des fonctionnalités à grande valeur ajoutée.\n    - Accueillez positivement les changements de besoins, même tard dans le projet.\n    - Livrez fréquemment un logiciel fonctionnel, dans des cycles de quelques semaines à quelques mois, avec une préférence pour les plus courts.\n    - Les utilisateurs ou leurs représentants et les développeurs doivent travailler ensemble quotidiennement tout au long du projet.\n    - Réalisez les projets avec des personnes motivées. Fournissez-leur l’environnement et le soutien dont elles ont besoin et faites-leur confiance pour atteindre les objectifs fixés.\n    - Privilégiez la co-location de toutes les personnes travaillant ensemble et le dialogue en face à face comme méthode de communication.\n    - Un logiciel fonctionnel est la principale mesure de progression d\'un projet.\n    - Les processus agiles encouragent un rythme de développement soutenable. Ensemble, les commanditaires, les développeurs et les utilisateurs devraient être capables de maintenir indéfiniment un rythme constant.\n    - Une attention continue à l\'excellence technique et à un bon design.\n    - La simplicité – c’est-à-dire l’art de minimiser la quantité de travail inutile – est essentielle.\n    - Les meilleures architectures, spécifications et conceptions émergent d\'équipes auto-organisées.\n    - À intervalles réguliers, l\'équipe réfléchit aux moyens possibles de devenir plus efficace. Puis elle s\'adapte et modifie son fonctionnement en conséquence.',_binary 'utf-8'),(7,_binary 'Created by Jez Humble, co-author of The DevOps Handbook and Accelerate, the CALMS framework is used as a means of assessing whether an organization is ready to adopt DevOps processes, or how an organization is progressing in their DevOps transformation. It is based on the following five pillars:\n\n=== Culture. ===\nBefore silos can be torn down, there needs to be a culture of shared responsibility, or at least a group of people devoted to establishing that culture in a grassroots type of way, with management approval and support.\n\n=== Automation. ===\nSimilar to the technical practices centered around continuous delivery mentioned above, teams undertaking a DevOps transformation should be devoted to automating as many manual tasks as possible, especially with respect to continuous integration and test automation.\n\n=== Lean.  ===\nDevelopment teams are making use of lean principles to eliminate waste and optimize the value stream, such as minimizing WIP, making work visible, and reducing hand-off complexity and wait times.\n\n=== Measurement.  ===\nThe organization is devoted to collecting data on their processes, deployments, etc., in order to understand their current capabilities and where improvements could be achieved.\n\n=== Sharing. ===\nA culture of openness and sharing within and between teams (and enabled with the proper tools) keeps everyone working toward the same goals and eases friction with hand-offs when issues arise.',_binary 'utf-8');
